import axios from 'axios'

const COURSE_API_URL = 'http://localhost:8080'
const WEATHER_API_URL = `${COURSE_API_URL}/weather`

class WeatherService {

    retrieveAllWeathers(sortBy, isAscending, filterBy, filterOperator, x) {
        //console.log('executed service')
        console.log(sortBy)
        console.log(filterBy)
        const requestOptions = {
            method : 'POST',

            headers : {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({"sortBy" : sortBy,
                                   "isAscending" : isAscending, 
                                   "filters" : {filterBy : x},
                                   "filterOperator" : filterOperator})
        }
        console.log(JSON.stringify({filterBy : x}))
        return fetch(`${WEATHER_API_URL}/retrieve/fromDb`, requestOptions.body);
    }
}
export default new WeatherService()
